import React from 'react';

export default function EventList({ events, loading, onSelect, onEdit, onDelete }) {
  if (loading) return <p>Loading events...</p>;
  if (!events.length) return <p>No events yet. Create one!</p>;
  return (
    <div className="panel">
      <h3>Events</h3>
      <ul className="list">
        {events.map(ev => (
          <li key={ev._id} className="event-item">
            <div>
              <strong>{ev.title}</strong>
              <div className="meta">{new Date(ev.date).toLocaleString()} â€” {ev.location || 'Online'}</div>
            </div>
            <div className="controls">
              <button className="btn small" onClick={()=>onSelect(ev)}>View</button>
              <button className="btn small" onClick={()=>onEdit(ev)}>Edit</button>
              <button className="btn small danger" onClick={()=>onDelete(ev._id)}>Delete</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
